import { Navbar} from '../components';

const PastPapers = () => {
  return (
    <div className="w-full min-h-screen">
      <Navbar />

      <div className="flex ml-[5%] mt-[10%] text-white font-poppins">
  <div className="flex w-full">
    <div className="mr-[10%]">
      <h2 className="text-xl">Biology</h2>
      <ul>
        <li>Paper 2000</li>
      </ul>
    </div>
    <div className="mr-[10%]">
      <h2 className="text-xl">Chemistry</h2>

    </div>
    <div className="mr-[10%]">
      <h2 className="text-xl">Physics</h2>
      {/* <!-- Add Physics related content here --> */}
    </div>
    <div className="mr-[10%]">
      <h2 className="text-xl">History</h2>
      {/* <!-- Add History related content here --> */}
    </div>
  </div>
</div>
</div>
  );
};

export default PastPapers;
